async function wait(ms) {
    const start = performance.now();
    return new Promise(resolve => {
        function check() {
            if (performance.now() - start >= ms) {
                resolve();
            } else {
                setTimeout(check, 1); // Check again after 1ms
            }
        }
        setTimeout(check, 1); // Initial check after 1ms
    });
}

